import React from "react";

const RegionSelectForm = () => {
  const onSubmitHandler = e => {
    e.preventDefault();
  };
  return (
    <div>
      <form onSubmit={onSubmitHandler}></form>
    </div>
  );
};

export default RegionSelectForm;
